import { blue } from "@mui/material/colors";
import { Box, fontSize } from "@mui/system";
import { useState, useEffect } from "react";
import Navbar from "../templates/Navbar";
import React, { Component } from 'react';
import Buyer_Navbar from "../templates/Buyer_Navbar";
import axios from "axios";
import Wallet from "./Wallet";
import { useNavigate, useLocation } from "react-router";

import { BrowserRouter as Router, Route, Link } from "react-router-dom";



const Buyer_edit = (props) => {
    const navigate = useNavigate();

    let location = useLocation();
    const [name, setUser] = useState("");
    const [contactNumber, setc] = useState("");
    const [age, setAge] = useState("");
    const [batch, setBatch] = useState("");
    const [password, setPass] = useState("");

    const [email, setEmail] = useState(localStorage.getItem("email"));
    const [type, setType] = useState(localStorage.getItem("type"));

    const onChangeUsername = (event) => {
        setUser(event.target.value);
    };

    const onChangeEmail = (event) => {
        setEmail(event.target.value);
    };
    const onChangeContact = (event) => {
        setc(event.target.value);
    };
    const onChangeAge = (event) => {
        setAge(event.target.value);
    };
    const onChangebatch = (event) => {
        setBatch(event.target.value);
    };
    const onChangePassword = (event) => {
        setPass(event.target.value);
    };

    const Nuser = {
        email: email,

    }

    useEffect(() => {

        axios
            .post('http://localhost:4000/user/xxx', Nuser)
            .then((response) => {
                console.log(response.data);
                if (response.data.val == 1) {
                    console.log(response.data);
                    setUser(response.data.name);
                    setAge(response.data.age);
                    setc(response.data.contactNumber);
                    setBatch(response.data.batch);
                    console.log(response.data);
                    console.log("here");

                }
                else {
                    alert("no fetch");
                }
            })
            .catch((error) => {
                console.log(error);
            }
            );          // setc(response.contactNumber)
    }, [])

    return (
        <div>
            <div> <Buyer_Navbar></Buyer_Navbar></div>
            {/* <div> <Wallet /> </div> */}
            <h3  className="center"> Profile edit </h3>
            <div  style={{marginTop:40}} >
                <Grid container align={"center"} spacing={3}>

                    <Grid item xs={12}>
                        <TextField
                            label="Name"
                            variant="outlined"
                            value={name}
                            onChange={onChangeUsername}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            label="Email"
                            variant="outlined"
                            value={email}
                            onChange={onChangeEmail}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            label="Contact Number"
                            variant="outlined"
                            value={contactNumber}
                            onChange={onChangeContact}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            label="Age"
                            variant="outlined"
                            value={age}
                            onChange={onChangeAge}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            label="Batch"
                            variant="outlined"
                            value={batch}
                            onChange={onChangebatch}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField

                            label="Password"
                            variant="outlined"
                            value={password}
                            type="password"
                            onChange={onChangePassword}
                        />
                     </Grid>
                    <Grid item xs={12}>
                        <Button variant="contained" onClick={onSubmit}>
                            Register
                        </Button>
                    </Grid>
                </Grid>
            </div>

             </div>

    );
};
export default Buyer_edit;
